<p>–ê–¥—Ä–µ—Å–∞: –≤—É–ª. –õ—ñ—Å–æ–≤–∞, 1, —Å–µ–ª–æ –ú–æ—â—É–Ω, –ö–∏—ó–≤—Å—å–∫–∞ –æ–±–ª. –°–ø–∞-–∫—É—Ä–æ—Ä—Ç –∑ –±–∞—Å–µ–π–Ω–æ–º.</p><img src="https://brovary.net.ua/wp-content/uploads/2020/09/zony-karantynu-koronavirus-10.09.2020-1.jpg" alt="–£ –ö–∏—î–≤—ñ –±–µ–∑—Ö–∞—Ç—á–µ–Ω–∫–∞–º –ø–æ–¥–∞—Ä—É—é—Ç—å —à–∫–∞—Ä–ø–µ—Ç–∫–∏" style="max-width: 480px; max-height: 480px;"/><p>–ù–∞ —Ç–µ—Ä–∏—Ç–æ—Ä—ñ—ó –≥–æ—Ç–µ–ª—é —î —Ä–µ—Å—Ç–æ—Ä–∞–Ω, —Å–µ–∑–æ–Ω–Ω–∏–π –≤—ñ–¥–∫—Ä–∏—Ç–∏–π –±–∞—Å–µ–π–Ω, –±–∞—Ä —ñ —Å–∞–¥. –ü—Ä–∞—Ü—é—î –¥–∏—Ç—è—á–∏–π –∫–ª—É–±, —î –±–µ–∑–∫–æ—à—Ç–æ–≤–Ω–∏–π wi-fi –Ω–∞ –≤—Å—ñ–π —Ç–µ—Ä–∏—Ç–æ—Ä—ñ—ó –∫–æ–º–ø–ª–µ–∫—Å—É, —î –±–µ–∑–∫–æ—à—Ç–æ–≤–Ω–∞ –ø–∞—Ä–∫–æ–≤–∫–∞.</p><strong><a id='k2'></a><h2>–ë—Ä–æ–≤–∞—Ä—ã | –ó–Ω–∞–∫–æ–º—Å—Ç–≤–∞ üíó | –ö–∏–µ–≤—Å–∫–∞—è –æ–±–ª–∞—Å—Ç—å ‚Äî mistaUA</h2></strong><p>–í—ñ–¥–Ω–æ–≤–∏—Ç–∏ —Å–∏–ª–∏ –≤—ñ–¥–ø–æ—á–∏–≤–∞–ª—å–Ω–∏–∫–∞–º –ø—Ä–æ–ø–æ–Ω—É—é—Ç—å —É —Å–ø–∞-—Ü–µ–Ω—Ç—Ä—ñ. –§–æ—Ç–æ: –ó–æ–Ω–∞ –≤—ñ–¥–ø–æ—á–∏–Ω–∫—É –Ω–∞–≤–∫–æ–ª–æ –≥–æ—Ç–µ–ª—é booking. –í—ñ–¥—Å—Ç–∞–Ω—å –≤—ñ–¥ –≥–æ—Ç–µ–ª—é –¥–æ –ö–∏—î–≤–∞ ‚Äî 30 –∫—ñ–ª–æ–º–µ—Ç—Ä—ñ–≤, –∞ –¥–æ –º—ñ—Å—Ç–∞ –ë–æ—Ä–∏—Å–ø—ñ–ª—å ‚Äî 27 –∫—ñ–ª–æ–º–µ—Ç—Ä—ñ–≤. –ï–≤—Ä–æ–ø–µ–π—Å—å–∫–∞ 1, —Å–µ–ª–æ –í–∏—à–µ–Ω—å–∫–∏, –ö–∏—ó–≤—Å—å–∫–∞ –æ–±–ª.</p><a id='k3'></a><h3>–ó–µ–ª–µ–Ω—Å—å–∫–∏–π –ø–æ–¥–∞—Ä—É–≤–∞–≤ —ñ–º–µ–Ω–∏–Ω–Ω–∏–∫—É –≤ –ù–æ–≤–∏—Ö –°–∞–Ω–∂–∞—Ä–∞—Ö –≥–æ–¥–∏–Ω–Ω–∏–∫ (–§–û–¢–û)</h3><p>–§–æ—Ç–æ: –°–ø–∞-–≥–æ—Ç–µ–ª—å –∑–∞ 30 –∫—ñ–ª–æ–º–µ—Ç—Ä—ñ–≤ –≤—ñ–¥ –ö–∏—î–≤–∞ booking. –ë—É—Ç–∏–∫-–≥–æ—Ç–µ–ª—å —Å –∫–æ—Å–º–µ—Ç–∏—á–Ω–∏–º–∏ –ø—Ä–æ—Ü–µ–¥—É—Ä–∞–º–∏. –£ –≥–æ—Ç–µ–ª—é —î —Å–ø–∞-—Ü–µ–Ω—Ç—Ä —ñ —Å—Ç–∏–ª—å–Ω—ñ –Ω–æ–º–µ—Ä–∏ –∑ –±–µ–∑–∫–æ—à—Ç–æ–≤–Ω–∏–º wi-fi. –í—Å—ñ –Ω–æ–º–µ—Ä–∏ –±—É—Ç–∏–∫-–≥–æ—Ç–µ–ª—é –æ—Å–Ω–∞—â–µ–Ω—ñ –∫–æ–Ω–¥–∏—Ü—ñ–æ–Ω–µ—Ä–æ–º —ñ —Ç–µ–ª–µ–≤—ñ–∑–æ—Ä–æ–º. –í –Ω–æ–º–µ—Ä–∞—Ö —î –±–∞–ª–∫–æ–Ω–∏ —Ç–∞ –æ–∫—Ä–µ–º–∞ –≤–∞–Ω–Ω–∞ –∫—ñ–º–Ω–∞—Ç–∞. –í–ª—ñ—Ç–∫—É –º–æ–∂–Ω–∞ –≤—ñ–¥–ø–æ—á–∏—Ç–∏ —É –≤—ñ–¥–∫—Ä–∏—Ç–æ–º—É –±–∞—Å–µ–π–Ω—ñ, –∞ –≤–∑–∏–º–∫—É ‚Äî —É —Å–ø–∞-—Ü–µ–Ω—Ç—Ä—ñ –∑ —Å–∞—É–Ω–æ—é, –ø–∞—Ä–æ–≤–æ—é –ª–∞–∑–Ω–µ—é —ñ –≥—ñ–¥—Ä–æ–º–∞—Å–∞–∂–Ω–æ—é –≤–∞–Ω–Ω–æ—é. –ü—Ä–∞—Ü—é—î —Ç—Ä–µ–Ω–∞–∂–µ—Ä–Ω–∏–π –∑–∞–ª, —î –≤–µ–ª–∏–∫–∏–π –≤–∏–±—ñ—Ä –∫–æ—Å–º–µ—Ç–∏—á–Ω–∏—Ö –ø—Ä–æ—Ü–µ–¥—É—Ä –¥–ª—è –æ–±–ª–∏—á—á—è —ñ —Ç—ñ–ª–∞.</p>
<p>–°—Ç–∞–Ω–¥–∞—Ä—Ç–Ω–∏–π –¥–≤–æ–º—ñ—Å–Ω–∏–π –Ω–æ–º–µ—Ä –∑ –¥–æ—Å—Ç—É–ø–æ–º –¥–æ —Å–ø–∞-—Å–∞–ª–æ–Ω—É –∫–æ—à—Ç—É—î 6 –≥—Ä–Ω –∑—ñ —Å–Ω—ñ–¥–∞–Ω–∫–æ–º. –ê–¥—Ä–µ—Å–∞: –û–±—É—Ö—ñ–≤—Å—å–∫–µ —à–æ—Å–µ 3, —Å–º—Ç¬†–ö–æ–∑–∏–Ω, –ö–∏—ó–≤—Å—å–∫–∞ –æ–±–ª. –§–æ—Ç–æ: –û–¥–∏–Ω –∑ –≥–æ—Ç–µ–ª—ñ–≤ –Ω–µ–ø–æ–¥–∞–ª—ñ–∫ –≤—ñ–¥ —Å—Ç–æ–ª–∏—Ü—ñ booking. –ë—ñ–ª—å—à –±—é–¥–∂–µ—Ç–Ω—ñ –≤–∞—Ä—ñ–∞–Ω—Ç–∏. –¶—ñ–Ω–∞ –∑–∞ –Ω–æ–º–µ—Ä ‚Äî –≤—ñ–¥ –≥—Ä–∏–≤–µ–Ω—å –∑–∞ –æ–¥–Ω—É –Ω—ñ—á –Ω–∞ –¥–≤–æ—Ö.</p><strong><a id='k4'></a><h2>–î–µ –∑—É—Å—Ç—Ä—ñ—á–∞—Ç–∏ –ù–æ–≤–∏–π —Ä—ñ–∫: –Ω–∞–π–±—ñ–ª—å—à –∫–∞–∑–∫–æ–≤—ñ —ñ –∞—Ç–º–æ—Å—Ñ–µ—Ä–Ω—ñ –º—ñ—Å—Ü—è –£–∫—Ä–∞—ó–Ω</h2></strong><p>–í—Å—å–æ–≥–æ –≤ –≥–æ—Ç–µ–ª—ñ ‚Äî —Ç—Ä–∏ –≤–∏–¥–∏ –Ω–æ–º–µ—Ä—ñ–≤. –í—Å—ñ —É–∫–æ–º–ø–ª–µ–∫—Ç–æ–≤–∞–Ω—ñ –¥–≤–æ–º–∞ –æ–¥–Ω–æ—Å–ø–∞–ª—å–Ω–∏–º–∏ –ª—ñ–∂–∫–∞–º–∏, —Ç—É–º–±–∞–º–∏, —Å—Ç–æ–ª–∞–º–∏ –π —à–∞—Ñ–∞–º–∏, –æ—Å–Ω–∞—â–µ–Ω—ñ –∫–æ–Ω–¥–∏—Ü—ñ–æ–Ω–µ—Ä–∞–º–∏ –π —Ç–µ–ª–µ–≤—ñ–∑–æ—Ä–∞–º–∏ –∑ –ø–ª–æ—Å–∫–∏–º –µ–∫—Ä–∞–Ω–æ–º. –§–æ—Ç–æ: –ì–æ—Ç–µ–ª—å –∑–∞ –º—ñ—Å—Ç–æ–º —É –ö–∏—ó–≤—Å—å–∫—ñ–π –æ–±–ª–∞—Å—Ç—ñ booking. –ü—Ä–∏ –≥–æ—Ç–µ–ª—ñ —î —Ä–µ—Å—Ç–æ—Ä–∞–Ω –∑—ñ —Å—Ç—Ä–∞–≤–∞–º–∏ —É–∫—Ä–∞—ó–Ω—Å—å–∫–æ—ó —Ç–∞ —î–≤—Ä–æ–ø–µ–π—Å—å–∫–æ—ó –∫—É—Ö–Ω—ñ. –ù–∞ —Ç–µ—Ä–∏—Ç–æ—Ä—ñ—ó —î –±–µ–∑–∫–æ—à—Ç–æ–≤–Ω–∞ –ø—Ä–∏–≤–∞—Ç–Ω–∞ –∞–≤—Ç–æ—Å—Ç–æ—è–Ω–∫–∞. –ê–¥—Ä–µ—Å–∞: —Å. –ü–µ—Ç—Ä–æ–ø–∞–≤–ª—ñ–≤—Å—å–∫–∞ –ë–æ—Ä—â–∞–≥—ñ–≤–∫–∞, –≤—É–ª. –ü–µ—Ç—Ä–æ–ø–∞–≤–ª—ñ–≤—Å—å–∫–∞  –ú—ñ–Ω—ñ-–≥–æ—Ç–µ–ª—å —ñ–∑ –∑–∞—Ç–∏—à–Ω–∏–º–∏ –Ω–æ–º–µ—Ä–∞–º–∏. –°–µ–Ω—Å —Ä–æ–±–∏—Ç–∏ –ª–æ–∫–¥–∞—É–Ω –∫–æ–ª–∏ —â–µ¬†–Ω—ñ—á–æ–≥–æ –Ω–µ¬†–ø–æ—á–∞–ª–æ—Å—è —ñ¬†–ø–æ—Ç—ñ–º –π–æ–≥–æ –∑–∞–≤–µ—Ä—à—É–≤–∞—Ç–∏ —è–∫—Ä–∞–∑ –∫–æ–ª–∏ –π–¥–µ —Ö–≤–∏–ª—è?</p>
<p>–í¬†—Ä—ñ–∑–Ω–∏—Ö –∫—Ä–∞—ó–Ω–∞—Ö –ø—ñ–∫ –±—É–≤ —É¬†—Ä—ñ–∑–Ω—ñ –ø–µ—Ä—ñ–æ–¥–∏, —â–æ¬†–ª–æ–≥—ñ—á–Ω–æ. –Ü¬†–∑–∞–º—ñ—Å—Ç—å –≤—ñ–¥—Å—Ç–µ–∂—É–≤–∞—Ç–∏ –¥–∞–Ω—ñ —ñ¬†–∑–∞¬†–Ω–∏–º–∏ –ø—Ä–∏–π–º–∞—Ç–∏ —Ä—ñ—à–µ–Ω–Ω—è –∫–ª–æ—É–Ω–∏ –ø—Ä–æ—Å—Ç–æ –ø–∞–ø—É–≥–∞–º–∏ –±–µ–∑–¥—É–º–Ω–æ –∫–æ–ø—ñ—é—é—Ç—å —É—Å–µ —â–æ¬†—ó–º¬†–∑–¥–∞—î—Ç—å—Å—è —è—Å–∫—Ä–∞–≤–∏–º —Ç–∞¬†–±–ª–∏—Å–∫—É—á–∏–º.</p>
		
			
