	<p>–í–æ–Ω–æ –∫–æ–Ω–µ—á–Ω–æ —Å¬†–û–≥–∞–π–æ –≤–∏–¥–Ω–µ–µ, —Å–æ¬†—Å—Ç—Ä–∞–Ω—ã –∫–æ—Ç–æ—Ä–∞—è –∑–∞–Ω–∏–º–∞–µ—Ç –ø–µ—Ä–≤–æ–µ –º–µ—Å—Ç–æ –≤¬†–º–∏—Ä–µ –ø–æ¬†–∫–æ–ª–∏—á–µ—Å—Ç–≤—É –∑–∞—Ä–∞–∂—ë–Ω–Ω—ã—Ö. –ú—ñ—Å—Ü–µ–ø–æ–ª–æ–∂–µ–Ω–Ω—è —è–∫–æ—Å—å –≤–ø–ª–∏–≤–∞—î –Ω–∞¬†–ø—Ä–∞–≤–æ –≥–æ–≤–æ—Ä–∏—Ç–∏ –ø—Ä–æ —â–æ—Å—å? –¢–∏–ø—É –ø—Ä–æ –ø—Ä–∞–¥–∞–≤–Ω—ñ–π –Ñ–≥–∏–ø—Ç –º–æ–∂–µ—à –≥–æ–≤–æ—Ä–∏—Ç–∏ –ª–∏—à–µ —è–∫—â–æ –∂–∏–≤–µ—à —É¬†–Ω—å–æ–º—É, –∞¬†–ø—Ä–æ –∫–æ—Å–º–æ—Å¬†‚Äî –ª–∏—à–µ –∫–æ–ª–∏ —É¬†–∫–æ—Å–º–æ—Å—ñ? –ß–µ—Å–Ω–æ –∫–∞–∂—É—á–∏ –¥–æ–≤–æ–ª—ñ –Ω–µ–¥–æ–ª—É–≥–∞ —Å–ø—Ä–æ–±–∞ –Ω–µ¬†–¥–∞—Ç–∏ –≥–æ–≤–æ—Ä–∏—Ç–∏. –ú–æ–≥—É –∏–∑¬†–ê–≤—Å—Ç—Ä–∞–ª–∏–∏ –Ω–∞–∫–∏–Ω—É—Ç—å –ì–¥–µ –∑–∞¬†–Ω–µ–¥–µ–ª—é¬†6 —à–µ—Å—Ç—å –æ—Ç–ª–æ–≤–ª–µ–Ω–Ω—ã—Ö —Å–ª—É—á–∞–µ–≤ –ø–µ—Ä–µ–¥–∞—á–∏ –≤–∏—Ä—É—Å–∞ –≤–Ω—É—Ç—Ä–∏ –æ–±—â–µ—Å—Ç–≤–∞ –∏¬†62¬†–ø—Ä–∏–≤–æ–∑–Ω—ã—Ö –∏–∑-–∑–∞ –±—É–≥—Ä–∞. –ê–¥–µ–ª–∞–∏–¥—É, –¥–∞–≤–µ—á–∞, –≤¬†–ª–æ–∫–¥–∞—É–Ω –∑–∞¬†–Ω–µ—Å–∫–æ–ª—å–∫–æ —á–∞—Å–æ–≤ –ø–æ—Å–ª–µ –≤—ã—è–≤–ª–µ–Ω–∏—è –∫–ª–∞—Å—Ç–µ—Ä–∞ –Ω–∞¬†17¬†—Å–ª—É—á–∞–µ–≤ –∑–∞–∫—Ä—ã–ª–∏.</p>
<p>–ß–µ—Ä–µ–∑ –¥–µ–Ω—å, –ø—Ä–∞–≤–¥–∞, –æ—Å–ª–∞–±–∏–ª–∏ –º–µ—Ä—ã –ø–æ—Å–ª–µ —Ç–æ–≥–æ, –∫–∞–∫ –≤—ã—è—Å–Ω–∏–ª–æ—Å—å, —á—Ç–æ –æ–¥–∏–Ω –∏–∑¬†–∑–∞—Ä–∞–∂–µ–Ω–Ω—ã—Ö —Å–æ–≤—Ä–∞–ª –ø—Ä–æ –ø—É—Ç–∏ –∑–∞—Ä–∞–∂–µ–Ω–∏—è –≤–∏—Ä—É—Å–æ–º –∏¬†—Å¬†–∫–æ–Ω–∫—Ä–µ—Ç–Ω–æ —ç—Ç–æ–≥–æ —à—Ç–∞–º–º–∞ –≤–∏—Ä—É—Å–∞ —Å–Ω—è–ª–∏ –ø–æ–¥–æ–∑—Ä–µ–Ω–∏–µ –Ω–∞¬†—Å–∏–ª—å–Ω–æ –±–æ–ª—å—à—É—é, —á–µ–º –æ–±—ã—á–Ω–æ, –≤–∏—Ä—É–ª–µ–Ω—Ç–Ω–æ—Å—Ç—å. –ê¬†—Ç–æ, —á—Ç–æ –¥–µ–ª–∞–µ—Ç—Å—è –≤¬†–£–∫—Ä–∞–∏–Ω–µ¬†‚Äî –∫–∞—Ä–≥–æ-–∫—É–ª—å—Ç –≤¬†—á–∏—Å—Ç–æ–º –≤–∏–¥–µ. –í—Å–µ –ø–æ–±–µ–∂–∞–ª–∏¬†‚Äî –∏¬†—è¬†–ø–æ–±–µ–∂–∞–ª, –Ω–æ¬†–º–µ–¥–ª–µ–Ω–Ω–æ –∏¬†—á—É—Ç—å –≤¬†–¥—Ä—É–≥—É—é —Å—Ç–æ—Ä–æ–Ω—É.</p>
